import './DetectCourse.css';
import React from 'react';
import logo from './img/IUAlogo.png';
import {Page, Pagebg, Title, PostArticleBtn, ChooseArticleBtn, ArticleList, ArticleText, ArticlePostTimeRating, ArticleContainer, ArticleFoodContainer, ArticleAuthor, ArticlePostTime, ArticlePostRating, ArticleBody}  from './components/ArticleStyle.js';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';

const DetectCourse=()=> {

    function DetectCourse_all(){
        return(
        <ArticleContainer>
            <ArticleText onClick={handleShowFoodSubmit}>
                <ArticleAuthor>{author}</ArticleAuthor>
                <ArticleBody>{store}</ArticleBody>
                <ArticlePostTime>{rating+"顆星 " + post_time}</ArticlePostTime>
            </ArticleText>
        </ArticleContainer>
        );
    }


    function DetectCourse() {
      return (
        <div className="DetectCourse"> 
            <div className="DetectCourse_bg">
                <Title className='DetectCourse_title'>偵測課程</Title>
                <div className='DetectCourse_search_position'>
                    <input type='text' className='DetectCourse_search' placeholder="請輸入課號"></input>
                    <button className='DetectCourse_searchBtn'>搜尋</button>
                </div>
                
            </div>
        </div>
      );
    }

    return (

           
                <Routes>
                    <Route path="/" element={<DetectCourse />} />
                </Routes>
             
    );
}

export default DetectCourse;
